import React from "react";

function NavigationBar() {
   return (
      <div className="navbar">
         <ul className="navUl">
            {/* <Temp /> */}
            <h1 className="logo">
               <Link to="/">
                  <p>~D|Fetch~</p>
               </Link>
            </h1>
            <NavBarLinksTopics />
            <NavBarLinksSources />
            <NavBarLinksLang />
         </ul>
         <Date />
      </div>
   );
}

export default NavigationBar;
